import React from 'react';
import '../styles/card.css';
function Card(props) {
    return (
        <div className="cardcp">
            <div className="cardheader">{props.title}</div>
            <div className="cardbody">
                {props.cost ?
                    <div className="cardprice">
                        {props.price}
                    </div>
                    :
                    <div>

                    </div>
                }
            </div>
        </div>
    )

}
export default Card;
